import style from './Styles/Minmax.module.css';


function Minmax({date , day }) {
    return (
        <div className={style.cointainer}>
           <h2>{date}</h2>
           <div>

           </div>
           <div className={style.temp}>
           <p>{day.maxtemp_c}</p>
           <p>{day.mintemp_c}</p>
           </div>

        </div>
    )
}

export default Minmax
